    "If the proctoring software window is still open, close it now and confirm that you want to quit the application.": "\u0627\u06af\u0631 \u067e\u0646\u062c\u0631\u0647 \u0646\u0631\u0645 \u0627\u0641\u0632\u0627\u0631 \u062d\u0641\u0627\u0638\u062a \u0647\u0645\u0686\u0646\u0627\u0646 \u0628\u0627\u0632 \u0627\u0633\u062a\u060c \u0627\u06a9\u0646\u0648\u0646 \u0622\u0646 \u0631\u0627 \u0628\u0628\u0646\u062f\u06cc\u062f \u0648 \u062a\u0623\u06cc\u06cc\u062f \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0645\u0627\u06cc\u0644\u06cc\u062f \u0627\u0632 \u0628\u0631\u0646\u0627\u0645\u0647 \u062e\u0627\u0631\u062c \u0634\u0648\u06cc\u062f.",
